import logo from './logo.svg';
import './App.css';
import Mapa from './components/maps/Mapa';
import datosGeoJSON from './components/maps/datosGeoJSON'; // Importa los datos del archivo
import VehicleForm from './components/vehicle/vehicle'; // Importa los datos del archivo
import VehicleList from './components/vehicle/vehicleList'; // Importa los datos del archivo
import MenuBar from './components/menu/menuBar';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <MenuBar />
        <div className="App" style={{ display: 'flex', flexDirection: 'row' }}>
          <div style={{ flex: '1', minWidth: '40%' }}>
            <VehicleList />
          </div>
          <div style={{ flex: '1', minWidth: '60%' }}>
            {/* Aquí puedes renderizar tus componentes de Mapa y otras pantallas */}
            <Switch>
              <Route path="/mapa">
                <Mapa datosGeoJSON={datosGeoJSON} />
              </Route>
              {/* Agrega más rutas para otras pantallas */}
            </Switch>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
